// Core
import React from "react";

// Begin Component
// __________________________________________________________________________________________

/**
 *
 * Icons/Custom/DharmaLaxalt.tsx
 * @author Peter Laxalt
 * @description Arrow icon.
 *
 */
const DharmaLaxalt: React.FunctionComponent = () => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 215.21 173.21"
    preserveAspectRatio="none"
    style={{ background: "blue", height: "100vh", width: "100vw" }}
  >
    <defs>
      <style
        dangerouslySetInnerHTML={{
          __html: `
          .cls-1 {
            font-size: 173.56px;
            font-family: DharmaGothicC-ExBold, Dharma Gothic C;
            font-weight: 700;
            letter-spacing: 0em;

            fill: yellow
          }`,
        }}
      />
    </defs>
    <g>
      <g>
        <text className="cls-1" transform="translate(0 147.53) scale(1.15, 5)">
          LAXALT
        </text>
      </g>
    </g>
  </svg>
);

export default DharmaLaxalt;
